import React,{useState,useEffect} from 'react';
import axios from 'axios';
import logo from './logo.svg';
import fileSaver from 'file-saver';
import './App.css';



function App() {
  const [embalmers,setEmbalmers]=useState(null)
  const getData=async()=>{
    const data=await axios.get('http://localhost:3003/embalmer/list');
    setEmbalmers(data.data);
  }

  useEffect(()=>{
    getData();
    console.log(embalmers);
  },[])

  return (
    <div className="App">
       <h1>Hello World</h1> 
    </div>
  );
}

export default App;
